import axios from "axios";
import { useEffect, useState } from "react";


const Users = () => {

    const [users, setUsers] = useState([])

    useEffect(()=>{
        axios.get("http://localhost:3005/register/users")
        .then((response)=>setUsers((prevData)=>([...prevData, response.data])))
    },[]) 
    console.log("Users", users)
    return(
        <div>
            Users
        </div>
    )
}

export default Users;
